import { Col, Breadcrumb } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const FoldersHeaderBar = () => {
  return (
    <React.Fragment>
      <Col>
        <div className="folders-navigation">
          <Breadcrumb>
            <Breadcrumb.Item href="/index">
              <FontAwesomeIcon icon={"home"} size="2x" />
            </Breadcrumb.Item>
            <Breadcrumb.Item active href="/katalog">
              Strona główna
            </Breadcrumb.Item>
          </Breadcrumb>
        </div>
      </Col>
    </React.Fragment>
  );
};

export default FoldersHeaderBar;
